// import React, { useState } from "react";
// import { useParams } from "react-router-dom";
// import axios from "axios";
import "./ProjectsPath.css";
import Card from 'react-bootstrap/Card'
import { Link } from "react-router-dom";

export default function ProjectsPath() {
  // const { type } = useParams();
  return (
    <>
      <Card style={{ width: "18rem" }}>
        <Card.Body>
        <Link to={"web"}>
          <div className="paths-div">Web Applications</div>
        </Link>
        </Card.Body>
      </Card>

      <div className="paths">
        <Link to={"web"}>
          <div className="paths-div">Web Applications</div>
        </Link>
        <Link to={"android"}>
          <div className="paths-div">Android Applications</div>
        </Link>
        <Link to={"ios"}>
          <div className="paths-div">IOS Applications</div>
        </Link>
        <Link to={"userexperience"}>
          <div className="paths-div">User Experiance</div>
        </Link>
        <Link to={"userinterface"}>
          <div className="paths-div">User Interfaces</div>
        </Link>
        <Link to={"security"}>
          <div className="paths-div">Security Systems</div>
        </Link>
      </div>
    </>
  );
}
